import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-light bg-light fixed-top">
      <div className="container-fluid">
        <span className="navbar-brand mb-0 h1">TO - DO</span>
      </div>
    </nav>
  );
};

export default Navbar;
